import React, { Component } from 'react'
import Shoe from './Shoe'

export default class Shoelist extends Component {
    render() {
        const {productList} = this.props

        return (
            <div className='row'>
                {productList.map((item) => {
                    <Shoe product = {item}/>

                })}
            </div>
        )
    }
}
